import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axiosInstance from './api/axios';

const PropertyDashboard = () => {
    const [properties, setProperties] = useState([]);

    useEffect(() => {
        // Fetch the listed properties of the owner
        const fetchProperties = async () => {
            try {
                const response = await axiosInstance.get('/properties');
                setProperties(response.data.properties);
            } catch (error) {
                console.error('Error fetching properties:', error);
            }
        };

        fetchProperties();
    }, []);

    return (
        <div className="container mx-auto py-10">
            <h1 className="text-4xl font-bold mb-6">Your Listed Properties</h1>

            {properties.length > 0 ? (
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                    {properties.map((property) => (
                        <div key={property._id} className="bg-white p-6 rounded-lg shadow-md">
                            <h2 className="text-2xl font-semibold mb-4">{property.address}</h2>
                            <p className="mb-2"><strong>Rent:</strong> ₹{property.rent}</p>
                            <p className="mb-2"><strong>Deposit:</strong> ₹{property.deposit}</p>
                            <p className="mb-2"><strong>Payment Due Date:</strong> {property.paymentDueDate}</p>
                            <Link
                                to={`/property/${property._id}`}
                                className="text-blue-500 hover:underline"
                            >
                                View Details
                            </Link>
                        </div>
                    ))}
                </div>
            ) : (
                <p className="text-lg text-gray-700">You haven't listed any properties yet.</p>
            )}
        </div>
    );
};

export default PropertyDashboard;
